import styles from './PageNotFound.module.css'

const PageNotFound = () => {
    return (
        <div className={styles.conteudoContainer}>

            <span className={styles.text404}>404</span>

            <h1 className={styles.titulo}>
                Ops! Página não encontrada
            </h1>
        </div>
    )
}

export default PageNotFound
